import React, { Component } from 'react';

class GetExample extends Component {
  constructor(props){
    super(props);

    this.state = {
      items: []
    }
  }

  componentDidMount() {
    // Simple GET request using fetch
    fetch('localhost:3000/api/item/all')
        .then(response => response.json())
        .then(data => this.setState({ items: data.total }));
}

  render() {
    const { items} = this.state;
    return (<div>
        List of posts
        {
          items.length ?
          items.map(item => <div key={item.id}>{item.name}</div>) : null
        }
    </div>);
  }
}

export default GetExample;
